import os
import shutil
import binascii

parent_dir =  "test_data"
child_dirs = ["","csv_files","log_files","pcap_files","txt_files","bad_files","mixed_files"]

def TextFileWriter(path, data):
  for f in data:
    with open(os.path.join(path, f['filename']), 'w+') as destination_file:
      destination_file.write(f['content'])

def BinaryFileWriter(path, data):
  #content is assumed hex
  for f in data:
    content = binascii.a2b_hex(f['content'])
    with open(os.path.join(path, f['filename']), 'wb+') as destination_file:
      destination_file.write(content)

def CreateDirectories():
  for child_dir in child_dirs:
    directory = os.path.join(parent_dir, child_dir)
    if not os.path.exists(directory):
      os.makedirs(directory)

