def DeleteDirectories():
  for child_dir in child_dirs:
    directory = os.path.join(parent_dir, child_dir)
    if os.path.exists(directory):
      shutil.rmtree(directory)

def DeleteAll():
  if os.path.exists(parent_dir):
    shutil.rmtree(parent_dir)